import React from "react";


const Navigation = () => {

    return (

        <header className='navigation'>
            <div className='wrapper__navigation'>
                <h1 className='navigation__h1'> Salon Kosmetyczny</h1>
                <ul className='navigation__list__container'>
                    <li className='list__item'><a className='list__item__link' href="/"></a>HOME</li>
                    <li className='list__item'><a className='list__item__link' href="/"></a>US≈ÅUGI</li>
                    <li className='list__item'><a className='list__item__link' href="/"></a>KONTAKT</li>
                    <li className='list__item'><a className='list__item__link' href="/"></a>BLOG</li>
                </ul>
            </div>
        </header>
    )
}

export default Navigation;
